using System;
using System.Drawing;
using C1.Win.C1FlexGrid;

public static class Snippet
{
	public static void setFormat(Flex_DLL.Flex_DLL f)
	{
		f.AllowMerging=C1.Win.C1FlexGrid.AllowMergingEnum.Free;

		f.AutoSizeCols();
		f.Cols["残"].Width = 60;
		f.Cols["次回法定期限"].Width = 100;
		f.Cols["整理番号"].Width = 120;
		f.Cols["次回予定手続"].Width = 120;
		f.Cols["稟議No"].Width = 70;	
		f.Cols["事業部名"].Width = 90;
		f.Cols["年金管理者名"].Width = 100;		
		f.Cols["年金納付済年数"].Width = 90;		
		f.Cols["種別名"].Width = 90;
		f.Cols["出願略称名"].Width = 100;
		f.Cols["出願番号"].Width = 120; 		
		f.Cols["登録番号"].AllowMerging = true;
		f.Cols["備考"].Width = 180;
		f.Cols["請求項1"].Width = 180;
		f.Cols["請求項2"].Width = 180;



		f.AllowSorting = C1.Win.C1FlexGrid.AllowSortingEnum.SingleColumn;		

		f.Rows.DefaultSize = 40;

		f.AutoClipboard = true;				
		f.AllowFiltering = true;
		f.Styles.Alternate.BackColor = System.Drawing.Color.Lavender;
		f.ShowThemedHeaders = C1.Win.C1FlexGrid.ShowThemedHeadersEnum.None;
		f.Styles.SelectedRowHeader.BackColor = System.Drawing.Color.Yellow;
		f.Styles.SelectedColumnHeader.BackColor = System.Drawing.Color.YellowGreen;	


		//法定期限10日以内
		CellStyle cs10 = f.Styles.Add("kigen_10");		
		//cs.Font = new Font(cs.Font, FontStyle.Bold);
		//cs.ForeColor = Color.Red;
		cs10.BackColor = Color.Red;
		cs10.Font.Size = 10;

		//法定期限15日以内
		CellStyle cs15 = f.Styles.Add("kigen_15");
		cs15.BackColor = Color.Orange;

		//法定期限60日以内
		CellStyle cs60 = f.Styles.Add("kigen_60");
		cs60.BackColor = Color.YellowGreen;

		//法定期限６０日以内、稟議No未登録
		CellStyle nRn = f.Styles.Add("notRingNo");		
		nRn.BackColor = Color.Red;		

		int j = f.Cols.Count;
		for (int i=1; i<f.Rows.Count; i++){

			if(Convert.ToInt32(f.GetData(i,1))<=10){
				CellRange cr = f.GetCellRange(i,2,i,2);
				cr.Style = f.Styles["kigen_10"];
			}
			else if(Convert.ToInt32(f.GetData(i,1))<=15){
				CellRange cr = f.GetCellRange(i,2,i,2);
				cr.Style = f.Styles["kigen_15"];
			}
			else if(Convert.ToInt32(f.GetData(i,1))<=60){
				CellRange cr = f.GetCellRange(i,2,i,2);
				cr.Style = f.Styles["kigen_60"];				
			}

			if((Convert.ToInt32(f.GetData(i,1))<=60) && (Convert.ToString(f.GetData(i,5)).Equals(""))){
				CellRange cr = f.GetCellRange(i,5,i,5);
				cr.Style = f.Styles["notRingNo"];				
			}

			//if(Convert.ToInt32(f.GetData(i,5))==0){
			//	CellRange cr = f.GetCellRange(i,5,i,5);
			//	cr.Style = f.Styles["kigen_10"];			
			//}
		}



		f.Select(1,1);
	}
}

