public static class Snippet
{
	public static void saveexcel(Flex_DLL.Flex_DLL f1, System.String strFile, System.String strSheet1)
	{

		try{




			f1.Cols.Fixed = 0;
			C1.Win.C1FlexGrid.Extensions.SaveExcel(f1,@"C:\temp\HOUTEIKIGENLIST\" + strFile,strSheet1,C1.Win.C1FlexGrid.FileFlags.IncludeFixedCells);	
			f1.Cols.Fixed = 1;

		}
		catch(Exception _ex){
			System.Windows.Forms.MessageBox.Show(_ex.Message);
		}		

	}


}

