using System;

public static class Snippet
{
	public static System.Data.DataTable GetView_DataTable(System.String strConnection, System.String kigenfr, System.String kigento, System.Int32 zigyoubuId)
	{
 		System.Data.DataTable rtnTable = new System.Data.DataTable();
        string strSql;	

		strSql = ("Exec HOUTEIKIGEN_LIST '" + kigenfr + "','" + kigento +"'," + zigyoubuId );

		System.Data.SqlClient.SqlConnection connection = new System.Data.SqlClient.SqlConnection();
        connection.ConnectionString = strConnection;
        connection.Open();
		try {
			System.Data.SqlClient.SqlDataReader reader = GetReader(strSql,connection);
			rtnTable = CreateSchemaDataTable(reader);			
			reader.Close();
		}
        catch (Exception _Err) {
			System.Windows.Forms.MessageBox.Show(_Err.Message);	
		}
		finally {
            connection.Close();
        }

		//System.Windows.Forms.MessageBox.Show(rtnTable.Rows.Count.ToString());

        return rtnTable;


	}
	private static System.Data.SqlClient.SqlDataReader GetReader(string strSql,System.Data.SqlClient.SqlConnection connection) {
            System.Data.SqlClient.SqlCommand command = new System.Data.SqlClient.SqlCommand();
            command.Connection = connection;
            command.CommandText = strSql;
			command.CommandTimeout = 600;

            try {
                System.Data.SqlClient.SqlDataReader reader = command.ExecuteReader();
                return reader;
            }
            catch (Exception _Err) {
				System.Windows.Forms.MessageBox.Show(_Err.Message);
                return null;
            }
            finally {
                command.Dispose();
            }

        }

	private static System.Data.DataTable CreateSchemaDataTable(System.Data.SqlClient.SqlDataReader reader) {
            if ((reader == null)) {
				//System.Windows.Forms.MessageBox.Show("リーダーがぬる！");
                return null;
            }

            if (reader.IsClosed) {
				//System.Windows.Forms.MessageBox.Show("リーダーとじてる");
                return null;
            }

            System.Data.DataTable schema = reader.GetSchemaTable();
            System.Data.DataTable dt = new System.Data.DataTable();
            foreach (System.Data.DataRow row in schema.Rows) {
                System.Data.DataColumn col = new System.Data.DataColumn();
                col.ColumnName = row["ColumnName"].ToString();
                col.DataType = Type.GetType(row["DataType"].ToString());
                if (col.DataType.Equals(typeof(string))) {
                    col.MaxLength = int.Parse(row["ColumnSize"].ToString());
                }

                dt.Columns.Add(col);
            }

            while (reader.Read()) {
                System.Data.DataRow row = dt.NewRow();
                for (int i = 0; (i 
                            <= (reader.FieldCount - 1)); i++) {
                    row[i] = reader[i];
                }

                dt.Rows.Add(row);
            }

			//System.Windows.Forms.MessageBox.Show("スキーマから読めた");
            return dt;
       }


}

