                System.Data.DataColumn col = new System.Data.DataColumn();
                col.ColumnName = row["ColumnName"].ToString();
                col.DataType = Type.GetType(row["DataType"].ToString());
                if (col.DataType.Equals(typeof(string))) {
                    col.MaxLength = int.Parse(row["ColumnSize"].ToString());
                }

                dt.Columns.Add(col);
            }

            while (reader.Read()) {
                System.Data.DataRow row = dt.NewRow();
                for (int i = 0; (i 
                            <= (reader.FieldCount - 1)); i++) {
                    row[i] = reader[i];
                }

                dt.Rows.Add(row);
            }

			//System.Windows.Forms.MessageBox.Show("スキーマから読めた");
            return dt;
       }


}
